import React, { useState } from 'react';
import { auth } from '../firebaseConfig';
import { useNavigate, Link } from 'react-router-dom';
import FoodCategories from './FoodCategories';
import RestaurantList from './RestaurantList';
import { useCart } from '../context/CartContext';

const Home = () => {
  const navigate = useNavigate();
  const [selectedCategory, setSelectedCategory] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [location, setLocation] = useState('Current Location');
  const { cartItems } = useCart();

  const handleLogout = () => {
    auth.signOut().then(() => {
      navigate('/login');
    });
  };

  const handleSelectCategory = (category) => {
    setSelectedCategory(category);
  };

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  const handleLocationChange = (e) => {
    setLocation(e.target.value);
  };

  return (
    <>
      <header style={{ backgroundColor: '#d32f2f', color: 'white', padding: '10px 40px', display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
        <Link to="/" className="logo" style={{ color: 'white', fontSize: '28px', fontWeight: '700', textDecoration: 'none' }}>
          Tasty Bites
        </Link>
        <div style={{ display: 'flex', alignItems: 'center', gap: '20px', flexGrow: 1, marginLeft: '40px' }}>
          <input
            type="text"
            placeholder="Search for restaurants or dishes"
            value={searchTerm}
            onChange={handleSearchChange}
            style={{ flexGrow: 1, padding: '10px 15px', borderRadius: '6px', border: 'none', fontSize: '16px' }}
          />
          <select value={location} onChange={handleLocationChange} style={{ padding: '10px 15px', borderRadius: '6px', border: 'none', fontSize: '16px' }}>
            <option>Current Location</option>
            <option>New York</option>
            <option>San Francisco</option>
            <option>Los Angeles</option>
          </select>
        </div>
        <nav className="navbar" style={{ display: 'flex', gap: '25px', alignItems: 'center', marginLeft: '40px' }}>
          <Link to="/">Home</Link>
          <Link to="/account">Account</Link>
          <Link to="/cart" style={{ position: 'relative' }}>
            Cart
            {cartItems.length > 0 && (
              <span style={{
                position: 'absolute',
                top: '-5px',
                right: '-10px',
                backgroundColor: 'yellow',
                color: 'black',
                borderRadius: '50%',
                padding: '2px 6px',
                fontSize: '12px',
                fontWeight: 'bold',
              }}>
                {cartItems.reduce((total, item) => total + item.quantity, 0)}
              </span>
            )}
          </Link>
          <button onClick={handleLogout} className="btn-logout" style={{ backgroundColor: 'transparent', border: 'none', color: 'white', cursor: 'pointer', fontWeight: '600', fontSize: '16px' }}>
            Logout
          </button>
        </nav>
      </header>

      <section style={{
        backgroundImage: 'url(/images/home-bg.jpg)',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        color: 'white',
        padding: '80px 60px',
        textAlign: 'center',
        borderRadius: '8px',
        margin: '20px 40px'
      }}>
        <h1 style={{ fontSize: '48px', fontWeight: '700', marginBottom: '20px' }}>Delicious Food Delivered To You</h1>
        <p style={{ fontSize: '20px', marginBottom: '30px' }}>Explore the best restaurants and dishes in your city</p>
        <input
          type="text"
          placeholder="Search for restaurants or dishes"
          value={searchTerm}
          onChange={handleSearchChange}
          style={{ padding: '15px 20px', borderRadius: '30px', border: 'none', width: '50%', fontSize: '18px' }}
        />
      </section>

      <main className="main-content" style={{ padding: '20px 60px' }}>
        <FoodCategories onSelectCategory={handleSelectCategory} />
        <RestaurantList selectedCategory={selectedCategory} searchTerm={searchTerm} />
      </main>
    </>
  );
};

export default Home;
